import React from 'react';
import { makeStyles, withTheme } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid'
import Typography from '@material-ui/core/Typography';

import NavbarSection from '../products/NavbarSection'


import ImgPattern from '../../assets/img/pattern2.png'
import ImgProducts1 from '../../assets/img/p1.png'
import ImgProducts2 from '../../assets/img/p2.png'
import ImgProducts3 from '../../assets/img/p3.png'
import ImgProducts4 from '../../assets/img/p4.png'
import ImgProducts5 from '../../assets/img/p5.png'
import ImgStar5 from '../../assets/img/star5.png'
import ImgStar4 from '../../assets/img/star4.png'
import ImgStar3 from '../../assets/img/star3.png'

export default function Products() {
    const classes = useStyles();

    return (
        <div className={classes.firstDiv}>
            <Container>
                <NavbarSection />
                <Grid container>
                    <Grid item xs={6} sm={4}>
                        <ItemProduct name='Dummy Text' star='5' price='Rp 300.000' product={ImgProducts1} />
                    </Grid>
                    <Grid item xs={6} sm={4}>

                    </Grid>
                    <Grid item xs={6} sm={4}>

                    </Grid>
                </Grid>
            </Container>

        </div>
    )
}

const useStyles = makeStyles(theme => ({
    firstDiv: {
        backgroundImage: `url(${ImgPattern})`,
        backgroundSize: 'cover',
    },
    productImg: {
        width: '100%'
    },
    imgStar: {
        width: '60%',
        display: 'block',
        marginLeft: 'auto',
        marginRight: 'auto',
    }
}));

function ItemProduct(props) {
    const classes = useStyles();
    return (
        <div>
            <img src={Product1Img} className={classes.productImg} />
            <Typography variant="h4" gutterBottom align='center'>
                Product Text </Typography>
            <img className={classes.imgStar} src={Star5Img} />
            <Typography variant="subtitle1" gutterBottom align='center'>
                {props.price} </Typography>
        </div>
    )
}
